import React from 'react';
import {NavLink, useNavigate} from 'react-router-dom';
import {Button} from "react-bootstrap"
import { useAuth } from '../../contexts/AuthContext';

const SignedOutLinks = () => {    
    const navigate = useNavigate()
    const {logout} = useAuth()

    async function handleClick(e) {
        e.preventDefault()
        try{
           await logout() 
           navigate("/signin")
        } catch{
            return "Failed to logout"
        }

    }
   return (
       <>
        we are rendering signed out links
        <Button variant="outline-primary" as={Link} to="/signup">
              Sign Up
        </Button>
        <Button variant="primary" as={Link} to="/signin" className="ms-2">
            Sign In
        </Button>
        <Button variant="link" onClick={handleClick}>Log Out</Button>
        {/* <li><NavLink to='/' className='temp'>NN</NavLink></li> */}
       </>
   )
}
export default SignedOutLinks
